import React, { useState } from 'react'
import Modal from 'react-modal';

const Invitation = () => {
    const [modalIsOpen, setIsOpen] = useState(false);

    const closeModal = () => {
        setIsOpen(false);
    }

    return (
        <div>
            <Modal
                isOpen={modalIsOpen}
                onRequestClose={closeModal}
            >

            </Modal>
        </div>
    )
}

export default Invitation
